import React from 'react';
import {Card,Image, Icon, Grid} from 'semantic-ui-react';



import { IAffilie } from '../../../app/models/affilie';

const AffilieListItem: React.FC<{ affilie: IAffilie }> = ({ affilie }) => {
  //const host = affilie.attendees.filter(x => x.isHost)[0];
  return (

    <Grid columns={3} divided>
    <Grid.Row>
      <Grid.Column>
        <Image src='/images/wireframe/media-paragraph.png' />
      </Grid.Column>
      <Card>
    <Image src='https://react.semantic-ui.com/images/avatar/large/matthew.png' wrapped ui={false} style={{width: 150, height: 150}}/>
    <Card.Content>
    <Card.Header>{affilie.nom} {affilie.prenom}</Card.Header>
      <Card.Meta>
      {affilie.rest > 0 ? (
        <div>
        <b>  Rest : </b>
        <span className='date' style={{color: "Red" , fontWeight: "bold"}}>{affilie.rest}</span>
          <b>  Reliquat : </b>
         <span className='date' style={{color: "Red" , fontWeight: "bold"}}>{affilie.reliquat}</span>

        </div>

        ) : (
          <span className='date' style={{color: "Green" , fontWeight: "bold"}} >{affilie.rest}</span>
        )}



      </Card.Meta>
      <Card.Description>
        Matthew is a musician living in Nashville.
      </Card.Description>
    </Card.Content>
    <Card.Content extra>

        <Icon name='map marker alternate' />
        {affilie.adresse}

    </Card.Content>
  </Card>
    </Grid.Row>

  </Grid>



  );
};

export default AffilieListItem;
